const {
  default: ActionButton,
} = require("src/Components/UI/ActionButton/ActionButton");

const OrderTableBody = (props) => {
  return (
    <>
      {props.body.map((row, i) => {
        return (
          <tr key={i}>
            <td>{row.id}</td>
            <td>{row.order_number}</td>
            <td>{row.itemname}</td>
            <td>{row.sellcount}</td>
            <td>{row.sell_type}</td>
            <td>{row.updated_at}</td>
            <td>
              <ActionButton
                value="Update"
                class={classes.view}
                name="cil-align-center"
                action={viewHandler.bind(null, row.id)}
              />
            </td>
          </tr>
        );
      })}
    </>
  );
};
export default OrderTableBody;
